  SWIG_Python_SetConstant(d, "ALMM_TEST_F",SWIG_From_int(static_cast< int >(limix::ALMM::TEST_F)));
  SWIG_Python_SetConstant(d, "fixed",SWIG_From_int(static_cast< int >(limix::fixed)));
  SWIG_Python_SetConstant(d, "categorial",SWIG_From_int(static_cast< int >(limix::categorial)));
  SWIG_Python_SetConstant(d, "continuous",SWIG_From_int(static_cast< int >(limix::continuous)));
